module.exports = JSON.parse("{\"committee_divisions\":[{\"division\":\"Internal Committees\",\"committees\":[{\"name\":\"Website\",\"description\":\"The Website Committee works on developing and updating the McMurtry Website.\",\"members\":[{\"name\":\"Shaquille Que\",\"year\":\"2022\",\"email\":\"stq1@rice.edu\"},{\"name\":\"Tate Ward\",\"year\":\"2023\",\"email\":\"tgw2@rice.edu\"}]},{\"name\":\"Amenities\",\"description\":\"The Amenities Committee is responsible for the improvement and upkeep of the public spaces (such as the lounges, TV room, game room, outside on 5th Floor, and hang-out area in the Commons) throughout McMurtry. Each member of our committee is in charge of managing one space - and we’re open to any suggestions! We focus on creating a pleasant atmosphere throughout the college with rooms and amenities all students can utilize. The Amenities Committee strives to implement long-lasting enhancements that can be enjoyed by Murts for years to come!\",\"members\":[{\"name\":\"Julia Shi\",\"year\":\"2023\",\"email\":\"jjs15@rice.edu\"}]},{\"name\":\"Culinary\",\"description\":\"We serve as your liaisons between the college and the West Servery chefs and also plan food for FIT-Qs!\",\"members\":[{\"name\":\"Jazmine Castillo\",\"year\":\"2023\",\"email\":\"jdc12@rice.edu\"},{\"name\":\"An Luu\",\"year\":\"2022\",\"email\":\"ahl4@rice.edu\"},{\"name\":\"Grayson Kotzur\",\"year\":\"2022\",\"email\":\"gak3@rice.edu\"},{\"name\":\"Amy Mu\",\"year\":\"2021\",\"email\":\"awm6@rice.edu\"}]},{\"name\":\"Environmental\",\"description\":\"The Environmental Committee exists at McMurtry to keep the college's effect on Earth in the minds of every Murt. This committee aims to help raise awareness about the little things that everyone can do to reduce the college's overall environmental impact.\",\"members\":[{\"name\":\"Tyler Sak\",\"year\":\"2021\",\"email\":\"tcs9@rice.edu\"},{\"name\":\"Angie Fan\",\"year\":\"2023\",\"email\":\"alf13@rice.edu\"},{\"name\":\"Sarah Salvatore\",\"year\":\"2023\",\"email\":\"sas22@rice.edu\"},{\"name\":\"Sarah Swackhamer\",\"year\":\"2022\",\"email\":\"sws5@rice.edu\"}]},{\"name\":\"Innovation Space\",\"description\":\"Manages MIS and serves as liaison with IVP.\",\"members\":[{\"name\":\"Chloe Liebenthal\",\"year\":\"2023\",\"email\":\"csl11@rice.edu\"}]},{\"name\":\"Tech\",\"description\":\"The Technology Committee is responsible for everything from maintaining our computer lab to all of the A/V equipment in the Commons and PDR and this very website. The roles on this committee include Director of Technology, Webmaster, Computer Lab Associate, and Technology Associate.\",\"members\":[{\"name\":\"Mac Carr\",\"year\":\"2022\",\"email\":\"mcmurtrytech@gmail.com\"},{\"name\":\"Matthew Whaley\",\"year\":\"2022\",\"email\":\"mcmurtrytech@gmail.com\"},{\"name\":\"Aman Shanbhag\",\"year\":\"2023\",\"email\":\"mcmurtrytech@gmail.com\"},{\"name\":\"Bazin Sineshaw\",\"year\":\"2023\",\"email\":\"mcmurtrytech@gmail.com\"}]}]},{\"division\":\"External Committees\",\"committees\":[{\"name\":\"Alumni\",\"description\":\"Wondering how McMurtry alumni keep in touch with the best college at Rice? Look no further than the Alumni Committee. Our committee sends out a newsletter each semester during the school year to all McMurtry alums, updating them on what's going on at Rice and McMurtry. We also plan events at McMurtry that include alumni such as during Homecoming, McMurtry Day, and Beer Bike! Our goals are to reach out to the young, enthusiastic classes that just graduated our college and get them involved in making McMurtry's culture amazing.\",\"members\":[{\"name\":\"Alex Curylo\",\"year\":\"2021\",\"email\":\"alc10\"}]},{\"name\":\"Arts\",\"description\":\"The Arts committee is dedicated to hosting quality shows at McMurtry centered around all types of performing arts. Including talent shows and theatre productions, we want to facilitate the creativity of students at McMurtry and help each and every one on their journey of discovery in the arts world.\",\"members\":[{\"name\":\"Nicole Lhuillier\",\"year\":\"2023\"},{\"name\":\"Morgan Gage\",\"year\":\"2023\"}]},{\"name\":\"Associates\",\"description\":\"The Associates Committee serves as a liaison between McMurtry's students and associates. McMurtry associates are Rice faculty as well as adult professionals in the Houston area who are associated with Rice. They serve as mentors, friends, academic advisers, and general resources for students. The Associates Committee hosts intellectual events, monthly lunches, study breaks, holiday events, and a formal Associates' Night each semester. The committee also organizes O-week group lunches with associates, as well as a pre-O-week reception and dinner.\",\"members\":[{\"name\":\"Akshaya Venkatesh\",\"year\":\"2022\",\"email\":\"av54@rice.edu\"},{\"name\":\"Jennifer Adams\",\"year\":\"2023\"},{\"name\":\"Julia Shi\",\"year\":\"2023\"},{\"name\":\"Isabel Sjodin\",\"year\":\"2022\"},{\"name\":\"Manshi Patel\",\"year\":\"2023\"},{\"name\":\"Jazmine Castillo\",\"year\":\"2023\"}]},{\"name\":\"Historian\",\"description\":\"The Historian Committee.\",\"members\":[{\"name\":\"Lily Cao\",\"year\":\"2021\"}]},{\"name\":\"Murtchandise\",\"description\":\"The Murtchandise committee is responsible for the design and procurement of McMurtry merchanise.\",\"members\":[{\"name\":\"Melodi Doganay\",\"year\":\"2022\",\"email\":\"mnd2@rice.edu\"},{\"name\":\"Kaitlan Easley\",\"year\":\"2022\",\"email\":\"kde4@rice.edu\"},{\"name\":\"Elena Margolin\",\"year\":\"2022\",\"email\":\"erm7@rice.edu\"},{\"name\":\"Serene Lee\",\"year\":\"2022\"},{\"name\":\"Chloe Corbitt\",\"year\":\"2023\"},{\"name\":\"Chanel Ericsson\",\"year\":\"2023\"}]},{\"name\":\"Sports\",\"description\":\"The Intramural Sports committee serves several athletics-related roles, with the most important being getting Murts involved! By serving as liaison between McMurtry and IMS (the rec center), the sports committee works to promote both college and intramural sports, help people sign up, and represent McMurtry to IMS. Committee members also work with powerpuff (yay powderpuff!), work to get competing Murts in legit athletic swag, and generally love sports themselves.\",\"members\":[{\"name\":\"Grace Waterman\",\"year\":\"2023\"},{\"name\":\"Angelica Torres\",\"year\":\"2022\"},{\"name\":\"Cortez Walters\",\"year\":\"2023\"},{\"name\":\"Rishi Vas\",\"year\":\"2022\"}]},{\"name\":\"Traditions\",\"description\":\"The traditions committee is the link between current McMurtry and our past. They keep track of McMurtry history through photos, scrapbooks, articles, and the Rice archives. Even more than just recording the college history, they are capturing the history of each and every Murt student, so know one ever forgets their McMurtry experience.\",\"members\":[{\"name\":\"Natalie Festa\",\"year\":\"2022\"},{\"name\":\"Camille Villar\",\"year\":\"2023\"},{\"name\":\"Christa Westheimer\",\"year\":\"2023\"},{\"name\":\"Megan Liu\",\"year\":\"2022\"}]}]},{\"division\":\"Social Committees\",\"committees\":[{\"name\":\"External Socials\",\"description\":\"External Socials are simply put, very very social. We plan events that feature Murts interacting with other colleges, including McMurtry's public party and Pub night. Our goal is to create activities that every Murt would love to participate in and to find ways to make sure every member of our college feels connected to the community by simply doing FUN STUFF. We are always ready to hear any input that anyone might have, and we cannot wait to make this an amazing year!\",\"members\":[{\"name\":\"Mimi Chang\",\"year\":\"2023\"},{\"name\":\"Saanya Bhargava\",\"year\":\"2023\"},{\"name\":\"Joshua Miller\",\"year\":\"2023\"},{\"name\":\"Christa Westheimer\",\"year\":\"2023\"},{\"name\":\"Kristine Yuan\",\"year\":\"2023\"}]},{\"name\":\"Internal Socials\",\"description\":\"The Internal Socials committee - a group dedicated to fostering McMurtry spirit, bonding, and fun. But more importantly we’re dedicated to keeping McMurtry to as little studying as possible. The committee puts on various social events throughout the year including, but not limited to board game and movie nights, Fridays in the Quad, social mixer events and McSkate.\",\"members\":[{\"name\":\"Sarah Swackhamer\",\"year\":\"2022\"},{\"name\":\"Julia Engelhardt\",\"year\":\"2023\"},{\"name\":\"Vibha Sastri\",\"year\":\"2022\"},{\"name\":\"Dylan Nguyen\",\"year\":\"2022\"},{\"name\":\"Hannah Boyd\",\"year\":\"2022\"},{\"name\":\"Angie Fan\",\"year\":\"2023\"},{\"name\":\"Prathik Kalva\",\"year\":\"2023\"}]},{\"name\":\"Beer Bike\",\"description\":\"Beer Bike. Some say it's the best day of the year. Others say it's the best day of their lives (with the exception of the other Beer Bikes they were fortunate enough to attend). The Beer Bike Committee is in charge of making this monumentous day a reality for all of McMurtry to enjoy. Whether it be assisting the Biking or Chugging Teams, organizing water balloon filling, or rounding people up for an epic jack on… Duncan (of course) – there is something for everyone (including new students) to do!\",\"members\":[{\"name\":\"This\"},{\"name\":\"could be\"},{\"name\":\"youuu! :)\"}]},{\"name\":\"Seniors\",\"description\":\"Seniors Committee.\",\"members\":[{\"name\":\"Emily Duffus\",\"year\":\"2021\"},{\"name\":\"Sana Mohamed\",\"year\":\"2021\"},{\"name\":\"Em Echeverria\",\"year\":\"2021\"},{\"name\":\"George Pazos\",\"year\":\"2021\"}]}]},{\"division\":\"At Large Committees\",\"committees\":[{\"name\":\"Culturals\",\"description\":\"The McMurtry Cultural Committee exists to engage students in the diversity of the Houston community. Currently, Culturals subsidizes ethnic restaurants along the METRO-rail, provides themed study breaks, and is responsible for the college Hookah, amongst other fascinating cultural things. The committee also facilitates opportunities for free events and shows in Houston through a liaison with RPC. Here mostly to provide McMurtry with free food and concerts, the Cultural Committee ensures McMurtry is never short of fun things to do both within and beyond the hedges.\",\"members\":[{\"name\":\"Manshi Patel\",\"year\":\"2023\"},{\"name\":\"Rajpal Bal\",\"year\":\"2023\"},{\"name\":\"Ingrid He\",\"year\":\"2023\"},{\"name\":\"Cassie Castaneda\",\"year\":\"2023\"}]},{\"name\":\"Diversity\",\"description\":\"The Diversity Council.\",\"members\":[{\"name\":\"Tatyanna Epps\",\"year\":\"2022\"},{\"name\":\"Josselyn Munoz\",\"year\":\"2023\"},{\"name\":\"Catelin Davis\",\"year\":\"2021\"},{\"name\":\"Ynez Kerley\",\"year\":\"2023\"},{\"name\":\"Gordan Liu\",\"year\":\"2023\"},{\"name\":\"Anika Jain\",\"year\":\"2021\"}]}]}]}");

